import React from 'react';

import s from './Advert.module.css';
import img from './kalina_4.jpg';

const Advert = (pros) => {
    return (
        <div>
            <div className={s.container} style={{backgroundImage: `url("${img}")`}}>
                <span className={s.nameAd}>Куплю Xiaomi Redmi Mi 9</span>

                <span className={s.price}>50.000$</span>
                <span className={s.description}>Топ за свои деньги ага точно</span>
                <span className={s.datePublish}>30.03.2022</span>
            </div>
        </div>
    );
};

export default Advert;
